import React, { useState } from 'react';
import './Recipes.css';

const RecipesCarousel = ({ title, category }) => {
  const [currentIndex, setCurrentIndex] = useState(0);
  const [enrolled, setEnrolled] = useState(null);

  const goToNext = () => {
    if (currentIndex + 4 < category.length) {
      setCurrentIndex(currentIndex + 4);
    }
  };

  const goToPrev = () => {
    if (currentIndex - 4 >= 0) {
      setCurrentIndex(currentIndex - 4);
    }
  };

  const handleEnroll = (index) => {
    const enrollmentDate = new Date().toLocaleDateString();
    setEnrolled({ index, date: enrollmentDate });
  };

  const renderCategoryItems = (items) => {
    return items.map((item, index) => (
      <div className="recipe-item" key={index}>
        <img src={item.image} alt={item.title} className="recipe-image" />
        <h4>{item.title}</h4>
        <p>{item.description}</p>
        <button 
          className="enroll-btn" 
          onClick={() => handleEnroll(currentIndex + index)}
        >
          Enroll Now
        </button>
        {enrolled && enrolled.index === currentIndex + index && (
          <p className="enrollment-message">Enrolled Successfully.</p>
        )}
      </div>
    ));
  };

  return (
    <div className="recipe-section">
      <h3 className="recipe-title">{title}</h3>
      <div className="recipe-carousel">
        <button className="carousel-btn prev-btn" onClick={goToPrev}>
          ◄
        </button>
        <div className="carousel-content">
          <div className="recipe-row">
            {renderCategoryItems(category.slice(currentIndex, currentIndex + 4))}
          </div>
        </div>
        <button className="carousel-btn next-btn" onClick={goToNext}>
          ►
        </button>
      </div>
    </div>
  );
};

const Recipes = () => {
  const dessertRecipes = [
    { image: '/images/dessert1.jpg', title: 'Chocolate Cake', description: 'A rich and moist chocolate cake with a creamy frosting.' },
    { image: '/images/dessert2.jpg', title: 'Fruit Tart', description: 'A refreshing tart made with seasonal fruits on a buttery crust.' },
    { image: '/images/dessert3.jpg', title: 'Lemon Meringue Pie', description: 'A zesty and sweet lemon pie topped with a fluffy meringue.' },
    { image: '/images/dessert4.jpg', title: 'Cheesecake', description: 'A creamy and decadent cheesecake with a graham cracker crust.' },
    { image: '/images/dessert5.jpg', title: 'Apple Pie', description: 'A warm apple pie with cinnamon and a flaky golden crust.' },
    { image: '/images/dessert6.jpg', title: 'Chocolate Brownies', description: 'Fudgy brownies made with dark chocolate for an intense flavor.' },
    { image: '/images/dessert7.jpg', title: 'Cupcakes', description: 'Delicious cupcakes topped with buttercream frosting and sprinkles.' },
    { image: '/images/dessert8.jpg', title: 'Tiramisu', description: 'A classic Italian dessert made with coffee-soaked ladyfingers and mascarpone cream.' }
  ];

  const dinnerRecipes = [
    { image: '/images/dinner1.jpg', title: 'Spaghetti Bolognese', description: 'A savory spaghetti dish with a rich and meaty tomato sauce.' },
    { image: '/images/dinner2.jpg', title: 'Grilled Chicken Salad', description: 'A healthy salad with grilled chicken, fresh greens, and vinaigrette.' },
    { image: '/images/dinner3.jpg', title: 'Lamb Chops', description: 'Tender lamb chops grilled to perfection with a mint yogurt sauce.' },
    { image: '/images/dinner4.jpg', title: 'Vegetable Stir Fry', description: 'A colorful mix of vegetables stir-fried with soy sauce and sesame oil.' },
    { image: '/images/dinner5.jpg', title: 'Fish Tacos', description: 'Crispy fish with cabbage slaw wrapped in soft tortillas.' },
    { image: '/images/dinner6.jpg', title: 'Steak and Potatoes', description: 'A juicy steak paired with perfectly roasted potatoes.' },
    { image: '/images/dinner7.jpg', title: 'Vegetarian Pizza', description: 'A pizza topped with a variety of fresh vegetables and mozzarella.' },
    { image: '/images/dinner8.jpg', title: 'Chicken Parmesan', description: 'Breaded chicken cutlets topped with marinara sauce and melted cheese.' }
  ];

  return (
    <div>
      <RecipesCarousel title="Dessert Recipes" category={dessertRecipes} />
      <RecipesCarousel title="Dinner Recipes" category={dinnerRecipes} />
    </div>
  );
};

export default Recipes;
